import Navbar from './navbar';

const Register = () => {
    return(
        <div>
             <Navbar/>
             <div className="container card mt-10">
                <div className="card-body">
                    <h1 className="card-title ml-auto">African Impact Challenge</h1>
                </div>
             </div>
        </div>
    );
}

export default Register
